import React from 'react'

const Diary = ({diary ,addDiary}) => {
    console.log("Child render...")
    return(
        <>
       <h2>My Diary</h2>
      {diary.map((entry, index) => {
        return <p key={index}>{entry + " " + index}</p>;
      })}
      <button onClick={addDiary}>Add Todo</button>
        </>
    )
}
export default Diary;
